 import React from 'react'

import ExpensesItem from './ExpensesItem'
import "./Expenses.css"
import Card from './Card'
 function Expenses(props) {
	return (
		<Card className="expense">
			{props.item.map((el, id)=>{
				return (
					<ExpensesItem
						title={el.title}
						amout={el.amout}
						date={el.date}
						key = {id}
					/>
				)
			})}
		</Card>
	)
	
} 
export default Expenses
  
	
